Description:
MÔ TẢ CÔNG VIỆC 
- Quản lý các trang mạng xã hội và website liên quan đến lĩnh vực công ty đang hoạt động; 
- Phụ trách sáng tạo nội dung hấp dẫn và truyền tải lên các kênh mạng xã hội ; 
- Update thông tin sản phẩm lên website và các kênh truyền thông của công ty ; 
- Viết bài truyền thông quảng cáo các sản phẩm / dịch vụ, sự kiện của công ty; 
- Lên ý tưởng, kế hoạch và nội dung cho các chiến dịch marketing trên mạng xã hội ; 
- Đề xuất các hoạt động quảng bá thương hiệu của công ty ; 
- Tham gia vào các công việc liên quan của chiến dịch Digital Marketing. 
YÊU CẦU ỨNG VIÊN 
- Tốt nghiệp Cao đẳng / Đại học chuyên ngành Marketing /QTKD /Thương mại /Ngữ văn hoặc các ngành liên quan. 
- Có khả năng viết lách, sáng tạo nội dung. 
- Am hiểu về nền tảng Content Marketing. Có kiến thức về các kênh Social và thương mại điện tử . 
- Thông thạo tin học văn phòng, biết sử dụng photoshop, chỉnh sửa hình ảnh căn bản . 
- Ưu tiên ứng viên đã từng làm trong ngành du lịch hoặc có kinh nghiệm trong mảng thiết kế đồ họa, dựng phim . 
- Nhiệt huyết, sáng tạo, có trách nhiệm với công việc. 
QUYỀN LỢI ĐƯỢC HƯỞNG 
- Thu nhập hấp dẫn và tăng lương định kỳ hàng năm ; 
- Được cung cấp điện thoại, đồng phục, máy tính, .. để hỗ trợ cho công việc; 
- Có Kí túc xá dành cho nhân viên; 
- Làm việc trong môi trường công bằng, năng động, chuyên nghiệp và có nhiều cơ hội thăng tiến; 
- Đội ngũ nhân viên trẻ trung, thân thiện và cởi mở trong công việc sẽ giúp cho nhân viên mới nhanh chóng hòa nhập với môi trường làm việc và văn hóa; 
- Được đào tạo, huấn luyện các kỹ năng và chuyên môn cần thiết được thực hiện tại Công ty hoặc đào tạo các khóa học bên ngoài theo kế hoạch đào tạo của Công ty; 
- Du lịch team building hàng năm và thường xuyên có cơ hội tham gia các tour của Công ty để lấy dữ liệu phục vụ cho công việc; 
- Tổ chức khám sức khỏe định kỳ hàng năm; 
- Chế độ thưởng dựa vào năng suất làm việc, thành tích kinh doanh, thành tích chỉ tiêu, sáng kiến, thưởng lễ Tết, lương tháng 13 và những điều bất ngờ khác.... 
- Được hưởng đầy đủ các chính sách phúc lợi theo quy định của Công ty; 
- Các chế độ BHXH, BHYT, BHTN được thực hiện theo đúng quy định pháp luật và đảm bảo được hưởng đầy đủ các chế độ bảo hiểm.
